import React from "react";
import "../styles/form.css";
const Login = () => {
  return (
    <div id="Login">
      <div className="container">
        <div className="box">
          <label htmlFor="name">Name:</label>
          <input
            type="text"
            name="name"
            value={data.name}
            onChange={handleChange}
            placeholder="Name"
          />
        </div>
        <div className="box">
          <label htmlFor="email">Email:</label>
          <input
            type="text"
            name="email"
            value={data.email}
            onChange={handleChange}
            placeholder="Email"
          />
        </div>
      </div>
    </div>
  );
};

export default Login;
